const Head = () => {
    return (
        <section className="head">
            <div className="head">
                <nav className="navbar">
                    <ul class="nav-list">
                        <li><a href="#welcome-section">About</a></li>
                        <li><a href="#projects">Work</a></li>
                        <li><a href="#contact-section">Contact</a></li>
                    </ul>
                </nav>
            </div>
        </section>
    );
}

export default Head
